"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[1477],{10:r=>{r.exports=JSON.parse('{"blogPosts":[{"id":"how-to-use-vuex","metadata":{"permalink":"/blog/how-to-use-vuex","editUrl":"https://github.com/JonathanTube/Jonathan.Kong.github.com/tree/main/blog/2023-05-28-how-to-use-vitest.md","source":"@site/blog/2023-05-28-how-to-use-vitest.md","title":"vitest\u6d4b\u8bd5\u6846\u67b6\u7b80\u5355\u4f7f\u7528","description":"","date":"2023-05-28T00:00:00.000Z","formattedDate":"May 28, 2023","tags":[{"label":"frontend","permalink":"/blog/tags/frontend"},{"label":"vue","permalink":"/blog/tags/vue"},{"label":"test","permalink":"/blog/tags/test"}],"readingTime":0,"hasTruncateMarker":false,"authors":[],"frontMatter":{"slug":"how-to-use-vuex","title":"vitest\u6d4b\u8bd5\u6846\u67b6\u7b80\u5355\u4f7f\u7528","tags":["frontend","vue","test"]},"nextItem":{"title":"ES6-fetch","permalink":"/blog/2021/06/11/ES6-fetch"}},"content":""},{"id":"/2021/06/11/ES6-fetch","metadata":{"permalink":"/blog/2021/06/11/ES6-fetch","editUrl":"https://github.com/JonathanTube/Jonathan.Kong.github.com/tree/main/blog/2021-06-11-ES6-fetch.md","source":"@site/blog/2021-06-11-ES6-fetch.md","title":"ES6-fetch","description":"\u5411\u670d\u52a1\u5668\u53d1\u9001\u6570\u636e\u8bf7\u6c42\u7684\u65b9\u6848:","date":"2021-06-11T00:00:00.000Z","formattedDate":"June 11, 2021","tags":[],"readingTime":0.83,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"vitest\u6d4b\u8bd5\u6846\u67b6\u7b80\u5355\u4f7f\u7528","permalink":"/blog/how-to-use-vuex"},"nextItem":{"title":"How to use http-proxy-middleware","permalink":"/blog/2021/05/20/how-to-use-http-proxy-middleware"}},"content":"### \u5411\u670d\u52a1\u5668\u53d1\u9001\u6570\u636e\u8bf7\u6c42\u7684\u65b9\u6848:\\r\\n\\r\\n- \u7b2c\u4e00\u7c7b: XMLHttpRequest\\r\\n  - ajax: \u81ea\u5df1\u7f16\u5199\u8bf7\u6c42\u7684\u903b\u8f91\u548c\u6b65\u9aa4\\r\\n  - axios: \u7b2c\u4e09\u65b9\u5e93\uff0c\u5bf9 XMLHttpRequest \u8fdb\u884c\u5c01\u88c5 \u3010\u57fa\u4e8e promise \u8fdb\u884c\u5c01\u88c5\u3011\\r\\n- \u7b2c\u4e8c\u7c7b\uff1afetch\\r\\n\\r\\n  - ES6 \u5185\u7f6e\u7684 API\uff0c\u672c\u8eab\u5373\u4f7f\u57fa\u4e8e promise\uff0c\u7528\u5168\u65b0\u7684\u65b9\u6848\u5b9e\u73b0\u5ba2\u6237\u7aef\u548c\u670d\u52a1\u5668\u7aef\u7684\u6570\u636e\u8bf7\u6c42\\r\\n  - \u4e0d\u517c\u5bb9 IE\\r\\n  - \u673a\u5236\u7684\u5b8c\u5584\u5ea6\u4e0a\uff0c\u8fd8\u662f\u4e0d\u5982 XMLHttpRequest \u7684\uff1b\u4f8b\u5982: \u65e0\u6cd5\u8bbe\u7f6e\u8d85\u65f6\u65f6\u95f4\u3001\u6ca1\u6709\u5185\u7f6e\u7684\u8bf7\u6c42\u4e2d\u65ad\u7684\u5904\u7406...J\\r\\n\\r\\n- \u7b2c\u4e09\u7c7b: \u5176\u5b83\u65b9\u6848\uff0c\u4e3b\u8981\u662f\u8de8\u57df\u4e3a\u4e3b\\r\\n  - jsonp\\r\\n  - postMessage\\r\\n  - \u5229\u7528 img \u7684 src \u53d1\u9001\u8bf7\u6c42\uff0c\u5b9e\u73b0\u6570\u636e\u57cb\u70b9\u548c\u4e0a\u62a5! !\\r\\n    :::"},{"id":"/2021/05/20/how-to-use-http-proxy-middleware","metadata":{"permalink":"/blog/2021/05/20/how-to-use-http-proxy-middleware","editUrl":"https://github.com/JonathanTube/Jonathan.Kong.github.com/tree/main/blog/2021-05-20-how-to-use-http-proxy-middleware.md","source":"@site/blog/2021-05-20-how-to-use-http-proxy-middleware.md","title":"How to use http-proxy-middleware","description":"installation","date":"2021-05-20T00:00:00.000Z","formattedDate":"May 20, 2021","tags":[],"readingTime":1.925,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"ES6-fetch","permalink":"/blog/2021/06/11/ES6-fetch"},"nextItem":{"title":"vuex\u7b80\u5355\u4f7f\u7528","permalink":"/blog/2019/05/28/how-to-use-vuex"}},"content":":::tip\\r\\n\\r\\n## installation\\r\\n\\r\\n```js\\r\\n# yarn\\r\\n$ yarn add http-proxy-middleware\\r\\n\\r\\n# npm\\r\\n$ npm i http-proxy-middleware\\r\\n```\\r\\n\\r\\n## create setupProxy.js in your project src directory\\r\\n\\r\\n:::tip\\r\\n\\r\\n- \u5fc5\u987b\u8981\u653e\u5728\u9879\u76ee\u7684 src \u76ee\u5f55\u4e0b\\r\\n\\r\\n:::\\r\\n\\r\\n```js\\r\\nconst proxy = require(\\"http-proxy-middleware\\")\\r\\n\\r\\nmodule.exports = function (app) {\\r\\n  app.use(\\r\\n    // \u4ee3\u7406 1\\r\\n    proxy.createProxyMiddleware(\\"/api\\", {\\r\\n      // \u5339\u914d\u5230 \'/api\' \u524d\u7f00\u7684\u8bf7\u6c42\uff0c\u5c31\u4f1a\u89e6\u53d1\u8be5\u4ee3\u7406\u914d\u7f6e\\r\\n      target: \\"http://127.0.0.1:6000/api\\", // \u8bf7\u6c42\u8f6c\u53d1\u5730\u5740\\r\\n      changeOrigin: true, // \u662f\u5426\u8de8\u57df\\r\\n      /*\\r\\n        changeOrigin \u4e3a true \u65f6\uff0c\u670d\u52a1\u5668\u6536\u5230\u7684\u8bf7\u6c42\u5934\u4e2d\u7684host\u4e3a\uff1a127.0.0.1:6000\uff0c\u4e5f\u5c31\u662f\u4ee3\u7406\u5730\u5740\u7684 host\\r\\n        changeOrigin \u4e3a false \u65f6\uff0c\u670d\u52a1\u5668\u6536\u5230\u7684\u8bf7\u6c42\u5934\u4e2d\u7684host\u4e3a\uff1alocalhost:3000\uff0c\u4e5f\u5c31\u662f\u672c\u5730\u7ad9\u70b9\u5730\u5740\u7684 host\\r\\n        changeOrigin \u9ed8\u8ba4 false\uff0c\u4f46\u4e00\u822c\u9700\u8981\u5c06 changeOrigin \u503c\u8bbe\u4e3a true\uff0c\u6839\u636e\u81ea\u5df1\u9700\u6c42\u8c03\u6574\\r\\n      */\\r\\n      pathRewrite: {\\r\\n        \\"^/api\\": \\"\\" // \u91cd\u5199\u8bf7\u6c42\u8def\u5f84\\r\\n      }\\r\\n    }),\\r\\n    // \u4ee3\u7406 2\uff0c\u4e3a\u4ec0\u4e48 2 \u5199\u524d\u9762\uff0c\u56e0\u4e3a\u5339\u914d\u89c4\u5219\uff0c\u4e0a\u9762\u7b2c\u4e00\u4e2a\u5df2\u7ecf\u662f /api \u4e86\uff0c\u8981\u4e0d\u7136\u4f1a\u4f18\u5148\u5339\u914d\u5230\u7b2c\u4e00\u4e2a\u4ee3\u7406\u4e0a\\r\\n    proxy.createProxyMiddleware(\\"/2api\\", {\\r\\n      target: \\"http://127.0.0.1:6000/api\\",\\r\\n      changeOrigin: true,\\r\\n      pathRewrite: {\\r\\n        \\"^/2api\\": \\"\\"\\r\\n      }\\r\\n    }),\\r\\n    // \u4ee3\u7406 3\uff0c\u8fd9\u79cd\u5199\u6cd5\u662f\u6700\u89c4\u8303\u7684\uff0c\u524d\u540e\u90fd\u52a0 /\\r\\n    proxy.createProxyMiddleware(\\"/3api/\\", {\\r\\n      target: \\"http://127.0.0.1:6000/api/\\",\\r\\n      changeOrigin: true,\\r\\n      pathRewrite: {\\r\\n        \\"^/3api/\\": \\"\\"\\r\\n      }\\r\\n    }),\\r\\n    // \u4ee3\u7406 4\uff0c\u8fd9\u79cd\u4ee3\u7406\u6807\u8bc6\u5c3e\u90e8\u52a0 / \uff0c\u4ee3\u7406\u5730\u5740\u5c3e\u90e8\u6ca1\u6709\\r\\n    proxy.createProxyMiddleware(\\"/4api/\\", {\\r\\n      target: \\"http://127.0.0.1:6000/api\\",\\r\\n      changeOrigin: true,\\r\\n      pathRewrite: {\\r\\n        // \'^/4api/\': \'\'  // \u8fd9\u79cd\u66ff\u6362\u6210\u7a7a\uff0c\u4e5f\u6ca1\u95ee\u9898\uff0c\u4f46\u662f\u4e0d\u4e25\u8c28\\r\\n        \\"^/4api/\\": \\"/\\" // \u8fd9\u6837\u5199\u66f4\u89c4\u8303\\r\\n      }\\r\\n    })\\r\\n    // ..... \u591a\u4e2a\u4ee3\u7406\\r\\n  )\\r\\n}\\r\\n```\\r\\n\\r\\n## using examples\\r\\n\\r\\n```js\\r\\nuseEffect(() => {\\r\\n  // \'/api\'\\r\\n  $get(\\"/api/user/config_name\\")\\r\\n    .then((res) => {\\r\\n      console.log(res)\\r\\n    })\\r\\n    .catch((err) => {\\r\\n      console.log(err)\\r\\n    })\\r\\n  // \'/2api\'\\r\\n  $get(\\"/2api/user/config_name\\")\\r\\n    .then((res) => {\\r\\n      console.log(res)\\r\\n    })\\r\\n    .catch((err) => {\\r\\n      console.log(err)\\r\\n    })\\r\\n  // \'/3api/\'\\r\\n  $get(\\"/3api/user/config_name\\")\\r\\n    .then((res) => {\\r\\n      console.log(res)\\r\\n    })\\r\\n    .catch((err) => {\\r\\n      console.log(err)\\r\\n    })\\r\\n  // \'/4api/\'\\r\\n  $get(\\"/4api/user/config_name\\")\\r\\n    .then((res) => {\\r\\n      console.log(res)\\r\\n    })\\r\\n    .catch((err) => {\\r\\n      console.log(err)\\r\\n    })\\r\\n}, [])\\r\\n```"},{"id":"/2019/05/28/how-to-use-vuex","metadata":{"permalink":"/blog/2019/05/28/how-to-use-vuex","editUrl":"https://github.com/JonathanTube/Jonathan.Kong.github.com/tree/main/blog/2019-05-28-how-to-use-vuex.md","source":"@site/blog/2019-05-28-how-to-use-vuex.md","title":"vuex\u7b80\u5355\u4f7f\u7528","description":"\u9879\u76ee\u6839src\u76ee\u5f55\u5efa\u7acbstore\u6587\u4ef6","date":"2019-05-28T00:00:00.000Z","formattedDate":"May 28, 2019","tags":[{"label":"frontend","permalink":"/blog/tags/frontend"},{"label":"vue","permalink":"/blog/tags/vue"},{"label":"vuex","permalink":"/blog/tags/vuex"}],"readingTime":1.5,"hasTruncateMarker":false,"authors":[],"frontMatter":{"title":"vuex\u7b80\u5355\u4f7f\u7528","tags":["frontend","vue","vuex"]},"prevItem":{"title":"How to use http-proxy-middleware","permalink":"/blog/2021/05/20/how-to-use-http-proxy-middleware"},"nextItem":{"title":"\u5982\u4f55\u8bbe\u7f6e\u672c\u5730ssl\u6d4b\u8bd5\u73af\u5883","permalink":"/blog/2015/05/28/how-to-set-local-ssl"}},"content":"## \u9879\u76ee\u6839src\u76ee\u5f55\u5efa\u7acbstore\u6587\u4ef6\\r\\n - /src/store/index\\r\\n \\r\\n```js\\r\\nimport { createStore } from \'vuex\' // \u5bfc\u5165\\r\\nimport { toRaw } from \'vue\' // \u8fd9\u91cc\u662f\u6bd4\u8f83\u8ff7\u60d1\u7684\uff0cvue3\u9700\u8981\u7528\u5230\uff1b\u4f46\u662f\u65e2\u7136\u662fvue3\u4e86\u4e3a\u4ec0\u4e48\u4e0d\u7528pinia\\r\\n\\r\\nconst store = createStore({\\r\\n  state: {\\r\\n    myState: \'\' // \u5b9a\u4e49\u4e00\u4e2astate\u53d8\u91cf\uff0c\u4e5f\u53ef\u4ee5\u662f\u5bf9\u8c61\u7c7b\u578b\\r\\n  },\\r\\n  mutations: {\\r\\n    setMyState: (state, payload) => {\\r\\n      state.myState = payload.value\\r\\n    }\\r\\n  },\\r\\n  // \u53ef\u4ee5\u4e0d\u6dfb\u52a0action\uff0c\u4f46\u662faction\u7ed3\u5408dispatch\u4f7f\u7528\u662f\u5f02\u6b65\u8c03\u7528\\r\\n  actions: {\\r\\n    handlerMyState: (context, payload) => {\\r\\n      context.commit(\'setMyState\', payload)\\r\\n    }\\r\\n  },\\r\\n  getters: {\\r\\n    getMyState: (state) => {\\r\\n      return toRaw(state.myState) // \u5982\u679c\u662fvue3\u8fd4\u56de\u7684\u4f1a\u662fproxy\uff0c\u9700\u8981\u7528toRaw\u89e3\u6784\u4e00\u4e0b\u62ff\u5230\u771f\u5b9e\u7684\u503c\\r\\n    }\\r\\n  }\\r\\n})\\r\\n\\r\\nexport default store\\r\\n```\\r\\n\\r\\n## main.js\u4e2d\u914d\u7f6e\\r\\n```js title=\\"vue3\u7248\u672c\\"\\r\\nimport { createApp } from \'vue\'\\r\\nimport App from \'./App.vue\'\\r\\nimport store from \'./store\' // \u5bfc\u5165/src/store/index.js\\r\\nconst app = createApp(App)\\r\\napp.use(store) // \u6302\u8f7d\\r\\napp.mount(\'#app\')\\r\\n```\\r\\n\\r\\n```js title=\\"vue2\u7248\u672c\\"\\r\\nimport Vue from \'vue\'\\r\\nimport App from \'./App.vue\'\\r\\nimport store from \'./store\'\\r\\nnew Vue({\\r\\n  store, // \u4e00\u70b9\u5c0f\u5dee\u522b\\r\\n  render: h => h(App),\\r\\n}).$mount(\'#app\')\\r\\n```\\r\\n\\r\\n## vue\u6587\u4ef6\u4e2d\u4f7f\u7528\\r\\n```js title=\\"vue3\\"\\r\\n{/* <script setup> */}\\r\\n  import { useStore } from \'vuex\'\\r\\n  const store = useStore()\\r\\n  // \u540c\u6b65\u8c03\u7528\uff0csetMyState\u662fmutations\u4e2d\u7684\u65b9\u6cd5\u540d\\r\\n  store.commit(\\"setMyState\\", { value: \'my value\' })\\r\\n  // \u5f02\u6b65dispatch\u4fee\u6539\u503c\uff0chandlerMyState\u662faction\u4e2d\u7684\u65b9\u6cd5\u540d\\r\\n  store.dispatch(\'handlerMyState\', { value: \'my value\' })\\r\\n// <\/script>\\r\\n\\r\\n<span>{{store.getters[\'getMyState\']}}</span>\\r\\n```\\r\\n\\r\\n```js title=\\"vue2\\"\\r\\nthis.$store.state.myState\\r\\n<span>{{$store.state.myState}}</span>\\r\\n```"},{"id":"/2015/05/28/how-to-set-local-ssl","metadata":{"permalink":"/blog/2015/05/28/how-to-set-local-ssl","editUrl":"https://github.com/JonathanTube/Jonathan.Kong.github.com/tree/main/blog/2015-05-28-how-to-set-local-ssl.md","source":"@site/blog/2015-05-28-how-to-set-local-ssl.md","title":"\u5982\u4f55\u8bbe\u7f6e\u672c\u5730ssl\u6d4b\u8bd5\u73af\u5883","description":"\u4e00\u3001\u901a\u8fc7mkcert\u521b\u5efa\u672c\u5730\u8bc1\u4e66\u5e76\u52a0\u8f7d","date":"2015-05-28T00:00:00.000Z","formattedDate":"May 28, 2015","tags":[],"readingTime":1.95,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"vuex\u7b80\u5355\u4f7f\u7528","permalink":"/blog/2019/05/28/how-to-use-vuex"}},"content":"## \u4e00\u3001\u901a\u8fc7mkcert\u521b\u5efa\u672c\u5730\u8bc1\u4e66\u5e76\u52a0\u8f7d\\r\\n\\r\\n1. \u5b89\u88c5mkcert\\r\\n```\\r\\n  npm install -g mkcert\\r\\n```\\r\\n\\r\\n2. \u751f\u6210\u8bc1\u4e66\\r\\n```\\r\\n  mkcert create-ca\\r\\n  mkcert create-cert\\r\\n```\\r\\n\u751f\u6210\u4e86\u56db\u4e2a\u6587\u4ef6\\r\\n```\\r\\n  ca.crt\\r\\n  ca.key\\r\\n  cert.crt\\r\\n  cert.key\\r\\n```\\r\\n\\r\\n## \u52a0\u8f7d\u8bc1\u4e66\\r\\n### mac\\r\\n- \u53cc\u51fbca.cert\uff0c\u5728\u5f39\u51fa\u7684\u754c\u9762\u9009\u62e9Test CA\uff0c\u9009\u62e9\u201c\u4fe1\u4efb\u201d\uff0c\u7136\u540e\u9009\u62e9\u201c\u59cb\u7ec8\u4fe1\u4efb\u201d\uff0c\u6700\u540e\u8f93\u5165\u5bc6 \u7801\u786e\u8ba4\u5373\u53ef\\r\\n### windows\\r\\n- \u53cc\u51fbca.crt\uff0c\u5728\u5f39\u51fa\u7684\u754c\u9762\u4e2d\u9009\u62e9\u5b89\u88c5\u8bc1\u4e66\uff0c\u9009\u62e9\u201c\u5f53\u524d\u7528\u6237\u201d\u6216\u201c\u672c\u5730\u8ba1\u7b97\u673a\u201d\u5747\u53ef\uff0c\u5173\u952e\u7684\u662f\u4e0b\u4e00\u6b65\uff0c\u9009\u62e9\u201c\u5c06\u6240\u6709\u7684\u8bc1\u4e66\u90fd\u653e\u5165\u4e0b\u5217\u5b58\u50a8\u201d\uff0c\u5e76\u4e14\u9009\u62e9\u4e3a\u201c\u53d7\u4fe1\u4efb\u7684\u6839\u8bc1\u4e66\u9881\u53d1\u673a\u6784\u201d\uff0c\u7136\u540e\u4e00\u8def\u786e\u5b9a\u5373\u53ef\\r\\n\\r\\n## \u4e8c\u3001\u5728vue\u6216uniapp\u4e2d\u4f7f\u7528\u521a\u521a\u7684\u8bc1\u4e66\\r\\n1. vue2\\r\\n```js\\r\\n// vue.config.js\\r\\nconst path = require(\'path\')\\r\\nconst fs = require(\'fs\')\\r\\nmodule.exports = {\\r\\n  devServer: {\\r\\n    open: true,\\r\\n    https: {\\r\\n      cert: fs.readFileSync(path.join(__dirname, \'src/ssl/cert.crt\')),\\r\\n      key: fs.readFileSync(path.join(__dirname, \'src/ssl/cert.key\'))\\r\\n    }\\r\\n  }\\r\\n}\\r\\n\\r\\n```\\r\\n2. vue3\\r\\n```js\\r\\n// vite.config.js\\r\\nimport { defineConfig } from \'vite\'\\r\\nimport vue from \'@vitejs/plugin-vue\'\\r\\nconst fs = require(\'fs\')\\r\\nconst path = require(\'path\')\\r\\nexport default defineConfig({\\r\\n  plugins: [vue()],\\r\\n  resolve: {\\r\\n    alias: {\\r\\n      \'@\': path.join(__dirname, \'src\')\\r\\n    }\\r\\n  },\\r\\n  server: {\\r\\n    open: true,\\r\\n    https: {\\r\\n      // \u4e3b\u8981\u662f\u4e0b\u9762\u4e24\u884c\u7684\u914d\u7f6e\u6587\u4ef6\uff0c\u4e0d\u8981\u5fd8\u8bb0\u5f15\u5165 fs \u548c path \u4e24\u4e2a\u5bf9\u8c61\\r\\n      cert: fs.readFileSync(path.join(__dirname, \'src/ssl/cert.crt\')),\\r\\n      key: fs.readFileSync(path.join(__dirname, \'src/ssl/cert.key\'))\\r\\n    }\\r\\n  }\\r\\n})\\r\\n```\\r\\n\\r\\n3. uniapp\\r\\n```json\\r\\n// manifest.json\\r\\n\\"h5\\" : {\\r\\n        \\"devServer\\" : {\\r\\n            \\"https\\" : {\\r\\n                \\"cert\\" : \\"\u590d\u5236cert.cer\u4e2d\u7684\u5168\u90e8\u5185\u5bb9\uff0c\u6362\u884c\u8f6c\u6362\u4e3a\\\\n\\"\\r\\n                \\"key\\" :  \\"\u590d\u5236cert.key\u4e2d\u7684\u5168\u90e8\u5185\u5bb9\uff0c\u6362\u884c\u8f6c\u6362\u4e3a\\\\n\\"\\r\\n            },\\r\\n            \\"proxy\\" : {} // \u8fd9\u4e2a\u5fc5\u987b\u5728\u8fd9\u91cc\u914d\u7f6e\uff0c\u56e0\u4e3avue.config.js\u4e2d\u7684\u4f1a\u51b2\u7a81\\r\\n        },\\r\\n        \\"async\\" : {\\r\\n            \\"delay\\" : \\"10000\\"\\r\\n        },\\r\\n        \\"router\\" : {\\r\\n            \\"base\\" : \\"./\\"\\r\\n        }\\r\\n    }\\r\\n```"}]}')}}]);